import React, {Component} from 'react';
import GetAllWord from "../../../components/DataDB/DataDB";

class ModalWindow extends Component {
    state = {
        words: []
    };
    componentDidMount() {
        GetAllWord().then(value => {
                this.setState({
                    words: value
                })
            }
        )
    }

    render() {
        return (
            <div>
                {!!(words) ? <ModalWindow words = {words} />: <h1>123</h1>}
            </div>
        );
    }
}

export default ModalWindow;
